import { useContext } from 'react'
import { UserContext } from '../../App'


function Recipe() {
    const { user } = useContext(UserContext)

    return (
        <>
            <h1>Recipes</h1>
            {user.recipes.map((recipe) => {
                <h1>{recipe.name}</h1>

            })}

        </>
    )
}

export default Recipe
